import axios from 'axios';
import React from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { setDrinksCards } from './Redux/slices/Drink';

function Adil() {
  const dispatch = useDispatch()
  const Drinks = useSelector(state => state.Drink.DrinksCards)

  React.useEffect(() => {
    axios
    .get('https://demo5518646.mockable.io/DrinksCard')
    .then((res) => {
      const dataObject = res.data.card; // Извлекаем массив данных
      const dataArray = Object.values(dataObject);
      dispatch(setDrinksCards(dataArray));
    })
    .catch((error) => {
      console.error("Ошибка при получении данных:", error);
    });
}, []);

  return (
    <div>
      {Drinks.map(card => (
        <div><h1>{card.price}</h1></div>
        ))}
    </div>
  )
}

export default Adil
